import React from "react";
import styled from "styled-components";

export const Main = styled.div`
  text-align: left;
  display: flex;
  width: 34rem;
  flex-direction: column;
  margin-top: 30px;
  /* border: 1px solid red; */
  margin-left: 63px;
`;

export const WorkspaceDiv = styled.div`
  background: #6a5ee5;
  padding-left: 19px;
  padding-top: 12px;
  padding-bottom: 12px;
  width: 392px;
  border-radius: 5px;
  color: white;
  text-align: center;
  outline: none;
  text-decoration: none;
`;

export const WorkspaceMain = styled.div`
  text-align: left;
  display: flex;
  width: 34rem;
  flex-direction: column;
  margin-top: 30px;
`;

export const SetupDiv = styled.div`
  text-align: left;
  display: flex;
  width: 34rem;
  flex-direction: column;
  margin-top: 30px;
  border: "1px solid red";
`;

export const SetupSubDiv = styled.div`
  gap: "25px";
  display: "flex";
  flexdirection: "row";
  padding: "13px";
  marginleft: "7%";
`;

export const SetupWorkspaceDiv = styled.div`
  background: "#6A5EE5";
  paddingleft: "19px";
  paddingtop: "12px";
  paddingbottom: "12px";
  width: "391px";
  borderradius: "5px";
  color: "white";
  textalign: "center";
  outline: "none";
  textdecoration: "none";
  marginleft: "4%";
  margintop: "10px";
`;

export const LaunchDiv = styled.div``;
